   extern crate shellexpand; // 1.0.0
   #[test]
   fn test_shellexpand() {
   let home = std::env::var("HOME").unwrap();
   assert_eq!(shellexpand::tilde("~/foo"), format!("{}/foo", home));
   }

Alternatively, you could try it with <code>
<span class="token trimmed">(1 more line was trimmed)</span></code> (crates.io). Here is a sketch:
   extern crate dirs; // 1.0.4
   use std::path::{Path, PathBuf};
   fn expand_tilde&gt;(path_user_input: P) -&gt; Option {
   let p = path_user_input.as_ref();
   if !p.starts_with("") {
       return Some(p.to_path_buf());
   }
   if p == Path::new("") {
       return dirs::home_dir();
   }
   dirs::home_dir().map(|mut h| {
       if h == Path::new("/") {
           // Corner case: <code>
<span class="token trimmed">(1 more line was trimmed)</span></code> root directory;
           // don't prepend extra <code>
<span class="token trimmed">(1 more line was trimmed)</span></code>, just drop the tilde.
           p.strip_prefix("").unwrap().to_path_buf()
       } else {
           h.push(p.strip_prefix("/").unwrap());
           h
       }
   })
   }


